INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-363.0, 2.12, "2025/01/31 12:00:00", "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", "2030/01/01 14:59:59", 5, "カリン", 64, 1000005, 2, 190804, 0.0, 1, 1);
