INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-363.0, 2.33, "2025/01/31 12:00:00", "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", "2030/01/01 14:59:59", 7, "カリン", 64, 1000007, 2, 190804, 0.0, 1, 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 5.18, "2025/01/31 12:00:00", "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", "2030/01/01 14:59:59", 101, "ラビリスタ", 61, 1020101, 3, 133701, -6.0, 10201, 7);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 8.77, "2025/01/31 12:00:00", "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", "2030/01/01 14:59:59", 201, "クリスティーナ", 61, 1020102, 1, 133901, -2.0, 10201, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 15.5, "2025/01/31 12:00:00", "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", "2030/01/01 14:59:59", 301, "ネネカ", 61, 1020103, 6, 133801, 0.0, 10201, 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 9.061, "2025/02/28 12:00:00", "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", "2030/01/01 14:59:59", 101, "ランファ", 61, 1020201, 2, 134301, 0.0, 10202, 5);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 7.699, "2025/02/28 12:00:00", "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", "2030/01/01 14:59:59", 201, "チカ", 61, 1020202, 1, 134401, 0.0, 10202, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 8.595, "2025/03/31 12:00:00", "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", "2030/01/01 14:59:59", 101, "アオイ", 61, 1020301, 1, 134601, 0.0, 10203, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 7.758, "2025/03/31 12:00:00", "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", "2030/01/01 14:59:59", 201, "クローチェ", 61, 1020302, 1, 134501, 0.0, 10203, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 7.0, "2025/04/30 12:00:00", "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", "2030/01/01 14:59:59", 101, "ルイズマリー", 61, 1020401, 2, 132302, 0.0, 10204, 6);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 7.904, "2025/04/30 12:00:00", "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", "2030/01/01 14:59:59", 201, "イロハ", 61, 1020402, 1, 132402, 0.0, 10204, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 8.487, "2025/04/30 12:00:00", "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", "2030/01/01 14:59:59", 301, "ソノ", 61, 1020403, 4, 132502, 0.0, 10204, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 8.763, "2025/05/31 12:00:00", "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", "2030/01/01 14:59:59", 101, "カノン", 61, 1020502, 1, 134901, 0.0, 10205, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 6.417, "2025/05/31 12:00:00", "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", "2030/01/01 14:59:59", 201, "ツムギ", 61, 1020503, 1, 134801, 0.0, 10205, 3);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 10.335, "2025/06/30 12:00:00", "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", "2030/01/01 14:59:59", 101, "エリス", 61, 1020601, 3, 135001, 0.0, 10206, 7);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 6.281, "2025/06/30 12:00:00", "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", "2030/01/01 14:59:59", 201, "シェフィ", 61, 1020602, 2, 135101, 0.0, 10206, 4);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 12.244, "2025/06/30 12:00:00", "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", "2030/01/01 14:59:59", 301, "プレシア", 61, 1020603, 1, 135201, 0.0, 10206, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 6.339, "2025/07/31 12:00:00", "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", "2030/01/01 14:59:59", 101, "クリア", 61, 1020701, 2, 135301, 0.0, 10207, 8);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 8.184, "2025/07/31 12:00:00", "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", "2030/01/01 14:59:59", 201, "アネモネ", 61, 1020702, 7, 135401, 0.0, 10207, 9);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 3.906, "2025/08/31 12:00:00", "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", "2030/01/01 14:59:59", 101, "アイラ", 61, 1020801, 9, 129101, 0.0, 10208, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 14.465, "2025/08/31 12:00:00", "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", "2030/01/01 14:59:59", 201, "シナツ", 61, 1020802, 1, 129201, 0.0, 10208, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 8.662, "2025/08/31 12:00:00", "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", "2030/01/01 14:59:59", 301, "ヒヨリ", 61, 1020803, 4, 100101, 0.0, 10208, 3);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 10.915, "2025/08/31 12:00:00", "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", "2030/01/01 14:59:59", 401, "レイ", 61, 1020804, 1, 100301, 0.0, 10208, 3);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 6.042, "2025/09/30 12:00:00", "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", "2030/01/01 14:59:59", 101, "ユキノ", 61, 1020901, 1, 135802, 0.0, 10209, 7);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 9.402, "2025/09/30 12:00:00", "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", "2030/01/01 14:59:59", 201, "サツキ", 61, 1020902, 4, 135903, 0.0, 10209, 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 8.16, "2025/09/30 12:00:00", "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", "2030/01/01 14:59:59", 301, "ルルィ", 61, 1020903, 8, 136902, 0.0, 10209, 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 5.0, "2025/10/31 12:00:00", "ひさしぶりのジオ・ゲヘナ\n歓迎パーティーで起きた殺人事件！\nランドソルの名探偵の名にかけて\n解き明かしてみせようじゃないか！", "2030/01/01 14:59:59", 101, "カスミ", 61, 1021001, 3, 137401, 0.0, 10210, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 8.12, "2025/10/31 12:00:00", "…わたしはどこの誰なのでしょう\nどこから来てどこへ行くのでしょう\nこの事件の真相が分かれば、\n何かが掴めるような気がいたします", "2030/01/01 14:59:59", 201, "アラクネ", 61, 1021002, 4, 136001, 0.0, 10210, 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 6.386, "2025/10/31 12:00:00", "ナーナ、すいりとかろんぱとか、\nむずかしくてわかんないけど…\nお友だちとドーナツのためならっ\nせーいっぱいがんばるよっ！", "2030/01/01 14:59:59", 301, "ナーナ", 61, 1021003, 4, 136202, 0.0, 10210, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 7.438, "2025/11/30 12:00:00", "騎士クンに想いを伝えたい…だから\nミソラちゃん、わたしがんばるね！\n…あれ？　わたし、なんでこんなに\n必死になってるんだろう…？", "2030/01/01 14:59:59", 101, "ユイ", 61, 1021101, 3, 136402, 0.0, 10211, 4);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 8.35, "2025/11/30 12:00:00", "騎士さんとのデートはわたしに\nお任せです★　なのでユイさんは\n安心して計画に専念して…たくさん\nドキドキしちゃってくださいね", "2030/01/01 14:59:59", 201, "ミソラ", 61, 1021102, 1, 136302, 0.0, 10211, 5);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 5.0, "2025/12/31 12:00:00", "新しい年がやってくるね！\nお正月の料理も飾りつけも、\nお姉ちゃんにお任せだよ♪\nみんなで楽しく新年を迎えよう！", "2030/01/01 14:59:59", 101, "シズル", 61, 1021201, 1, 136501, 0.0, 10212, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 5.25, "2025/12/31 12:00:00", "おうちの掃除もトラブルも、 \n世界を揺るがす大ピンチも！\n今年のことは今年のうちに \nサッサと片付けちゃいますっ！", "2030/01/01 14:59:59", 201, "リノ", 61, 1021202, 1, 137902, 0.0, 10212, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (-285.0, 7.5, "2025/12/31 12:00:00", "年の瀬はギルドマスターも\nつい駆け回っちゃう忙しい時期だ！\n一年いろいろあったけど\nお互いイイ年を迎えよう、少年！", "2030/01/01 14:59:59", 301, "ラビリスタ", 61, 1021203, 1, 106801, 0.0, 10212, 2);
